//get the coordinates of the borders of all the hexagons
function getHexagons(response, resolution){

  // update the data in each hexagons
  var pointsInPolygon = {};
  axios.get(points_url).then(function(response){
    var points = response.data;
    points.forEach(function(point){
      var coordinates = point.location.coordinates;
      var h3Address = h3.geoToH3(coordinates[1], coordinates[0], resolution);
      var numPoints = pointsInPolygon[h3Address] || 0;
      pointsInPolygon[h3Address] = numPoints + 1;
    });
    return pointsInPolygon;
  }).then(function (pointsInPolygon) {
    //return the geojson with data
    const hexagons = h3.polyfill(polygon, resolution);
    var features = [];
    var cluster = {};
    hexagons.forEach(function(entry){
      if (!cluster[entry]){
        borders = h3.h3ToGeoBoundary(entry);
        borders.forEach(function(coord){
          var temp = coord[0];
          coord[0] = coord[1];
          coord[1] = temp;
        });
        var feature = {"type": "Feature",
                        "properties": {
                            "id": entry,
                            "num": pointsInPolygon[entry] || 0
                        },
                        "geometry": {
                            "type": "Polygon",
                            "coordinates": [borders]
                        }
                      };
        features.push(feature);
      }
      cluster[entry] = true;
    });
      response.send({
      "type": "FeatureCollection",
      "crs": { "type": "name", "properties": { "name": "urn:ogc:def:crs:OGC:1.3:CRS84" } },
      "features": features
    });
  }).catch(function (error) {
    console.log(error);
  }); 
}

